import React, { useState, useEffect } from 'react';

function Perfil() {
  const [nombre, setNombre] = useState('');
  const [email, setEmail] = useState('');
  const [rut, setRut] = useState('');
  const [patente, setPatente] = useState('');
  const [direccion, setDireccion] = useState('');
  const [fechaNacimiento, setFechaNacimiento] = useState('');
  const [afp, setAfp] = useState('');
  const [previsionSalud, setPrevisionSalud] = useState('');
  const [modoEdicion, setModoEdicion] = useState(false);

  useEffect(() => {
    const users = JSON.parse(localStorage.getItem('users')) || [];
    const userEmail = localStorage.getItem('userEmail');
    const usuario = users.find(u => u.email === userEmail);

    if (usuario) {
      setNombre(usuario.nombre);
      setEmail(usuario.email);
      setRut(usuario.rut);
      setPatente(usuario.patente);
      setDireccion(usuario.direccion);
      setFechaNacimiento(usuario.fechaNacimiento);
      setAfp(usuario.afp);
      setPrevisionSalud(usuario.previsionSalud);
    }
  }, []);

  const handleGuardarPerfilPersonal = () => {
    const users = JSON.parse(localStorage.getItem('users')) || [];
    const userEmail = localStorage.getItem('userEmail');
    const usuarioIndex = users.findIndex(u => u.email === userEmail);

    if (usuarioIndex === -1) {
      alert('Usuario no encontrado');
      return;
    }

    users[usuarioIndex] = {
      ...users[usuarioIndex],
      nombre,
      email,
      rut,
      patente,
      direccion,
      fechaNacimiento,
      afp,
      previsionSalud,
    };

    localStorage.setItem('users', JSON.stringify(users));
    alert('Perfil personal actualizado correctamente.');
  };

  return (
    <div>
      <h2>Perfil</h2>

      <div>
        <label>Nombre:</label>
        <input
          type="text"
          value={nombre}
          onChange={(e) => setNombre(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      <div>
        <label>Email:</label>
        <input
          type="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      <div>
        <label>RUT:</label>
        <input
          type="text"
          value={rut}
          onChange={(e) => setRut(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      {/* Datos adicionales del perfil */}
      <div>
        <label>Patente Vehículo:</label>
        <input
          type="text"
          value={patente}
          onChange={(e) => setPatente(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      <div>
        <label>Dirección:</label>
        <input
          type="text"
          value={direccion}
          onChange={(e) => setDireccion(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      <div>
        <label>Fecha de Nacimiento:</label>
        <input
          type="date"
          value={fechaNacimiento}
          onChange={(e) => setFechaNacimiento(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      <div>
        <label>Tipo AFP:</label>
        <input
          type="text"
          value={afp}
          onChange={(e) => setAfp(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      <div>
        <label>Previsión de Salud:</label>
        <input
          type="text"
          value={previsionSalud}
          onChange={(e) => setPrevisionSalud(e.target.value)}
          disabled={!modoEdicion}
        />
      </div>

      <button onClick={() => setModoEdicion(!modoEdicion)}>
        {modoEdicion ? 'Cancelar' : 'Editar Perfil'}
      </button>

      {modoEdicion && (
        <button onClick={handleGuardarPerfilPersonal}>Guardar Cambios</button>
      )}
    </div>
  );
}

export default Perfil;
